define('text!plugin/admin/templates/addAdmin_temp.html',[],function () { return '<div style="padding : 20px">\n  <h2 class="overlay-title">Add Admin</h2>\n  <div class="overlayActions">\n      <span class="action-item overlay-close app-btn" data-to-close="addAdminView">\n          <span class="material-icons">close</span>\n      </span>\n  </div>\n  <div id="addAdminView" class="modelbox">\n    <div class="clearfix">&nbsp;</div>\n\n<form id="adminDetails" name="adminDetails" action="#">\n    <div class="col-xs-12">\n        <div class="member-profile-img">\n            <img src="">\n        </div>\n    </div>\n    <div class="col-xs-12 form-control-row">\n        <div class="col-sm-12 has-feedback">\n          <label for="name">Name <span class="error">*</span> :</label>\n          <input id="name" class="form-control txtchange has-feedback-left" name="name" required="" type="text" value="<%=  model.name %>">\n          <span class="fa fa-user form-control-feedback left" aria-hidden="true"></span>\n          <div class="clearfix">&nbsp;</div>\n        </div> \n    </div>  \n    <div class="col-xs-12 form-control-row">  \n        <div class="col-sm-12 has-feedback">\n          <label for="email">Email-ID <span class="error">*</span> :</label>\n          <input id="email" class="form-control txtchange updateUserName has-feedback-left" name="email" required="" type="text" value="<%=  model.email %>">\n          <span class="fa fa-envelope form-control-feedback left" aria-hidden="true"></span>\n          <div class="clearfix">&nbsp;</div>\n        </div>  \n    </div>\n    <div class="col-xs-12 form-control-row">\n        <div class="col-sm-6 col-xs-12">\n          <label for="contactNo">Contact Number <span class="error">*</span> :</label>\n          <input id="contactNo" class="form-control txtchange" name="contactNo" required=""type="text" placeholder="Contact Number" value="<%=  model.contactNo %>">\n          <div class="clearfix">&nbsp;</div>\n      </div> \n       <div class="col-sm-6 col-xs-12">\n              <label for="whatsappNo">Whatsapp No <span class="error"></span> :</label>\n              <input id="whatsappNo" class="form-control txtchange" name="whatsappNo"  maxlength="45" type="text" placeholder="WhatsApp Number (Optional)" value="<%=  model.whatsappNo %>">\n              <div class="clearfix">&nbsp;</div>\n      </div>\n   </div>\n   <div class="col-xs-12 form-control-row">\n        <div class="col-sm-6 col-xs-12">\n          <label for="dateOfBirth">Date Of Birth<span class="error">*</span> :</label>\n          <input id="dateOfBirth" class="form-control txtchange" name="dateOfBirth" required=""type="date" value="<%=  model.dateOfBirth %>">\n          <div class="clearfix">&nbsp;</div>\n      </div>\n      <div class="col-sm-6 col-xs-12">\n        <div class="col-sm-12 has-feedback">\n          <label for="myTarget">My Target <span class="error">*</span> :</label>\n          <input id="myTarget" class="form-control txtchange has-feedback-left" name="myTarget" required="" type="text" value="<%=  model.myTarget %>">\n          <span class="fa fa-inr form-control-feedback left" aria-hidden="true"></span>\n          <div class="clearfix">&nbsp;</div>\n        </div> \n    </div>  \n   </div>\n   <div class="col-xs-12 form-control-row">\n        <div class="col-sm-12 col-xs-12">\n          <label for="address">Address <span class="error">*</span> :</label>\n          <textarea id="address" class="form-control txtchange " name="address" required="" value="<%=  model.address %>"><%=  model.address %></textarea>\n          <div class="clearfix">&nbsp;</div>\n      </div> \n   </div>\n     <div class="col-xs-12 form-control-row">\n        <div class="col-sm-6 has-feedback col-xs-12">\n              <label for="userName">User Name <span class="error">*</span> :</label>\n              <input id="userName" class="form-control txtchange has-feedback-left" name="userName" required=""type="text" value="<%=  model.userName %>">\n              <span class="fa fa-user form-control-feedback left" aria-hidden="true"></span>\n              <div class="clearfix">&nbsp;</div>\n      </div> \n       <div class="col-sm-6 col-xs-12">\n              <label for="password">Password <span class="error">*</span> :</label>\n              <input id="password" class="form-control txtchange" name="password" required="" maxlength="45" placeholder="auto generated"   type="text" value="<%=  model.password %>"\n              <%if(model.password==""){%>disabled=""<%}%>">\n              <div class="clearfix">&nbsp;</div>\n      </div>\n   </div>\n    <div class="col-xs-12 form-control-row"> \n         <div class="col-sm-6 col-xs-12">\n                <label for="roleID">User Role<span class="error">*</span> :</label>\n                <select id="roleID" name="roleID" class="form-control dropval">\n                  <option value="">Select User Role</option>\n                  <% _.each(userRoleList, function(model1) { %>\n                    <option <% if(model1.attributes.roleID == model.roleID){ %> selected <% } %> value="<%=model1.attributes.roleID%>"><%=model1.attributes.roleName%></option>\n                  <%}); %>\n            </select>\n            <div class="clearfix">&nbsp;</div>\n        </div> \n        <div class="col-sm-6 col-xs-12">\n                <label for="status">Status <span class="error">*</span> :</label>\n                <ul class="item-container" data-valid="status">\n                  <li class="status multiSel" data-single="Y" data-value="Active">Active</li>\n                  <li class="status multiSel" data-single="Y" data-value="inActive">InActive</li>\n                  <!-- <li class="status multiSel" data-single="Y" data-value="Delete">Delete</li> -->\n              </ul>\n            </div>\n    </div>\n     <div class="clearfix">&nbsp;</div>\n        \n        <div class="text-center">\n        <div class="clearfix">&nbsp;</div>\n        <button id="saveEduDetails" type="button" class="btn btn-default btn-success">Save</button>\n      </div>\n      </form>\n    </div>';});

