define('text!plugin/userRole/templates/userRoleSingle_temp.html',[],function () { return '<div style="padding : 20px">\n    <h2 class="overlay-title">Add Admin</h2>\n    <div class="overlayActions">\n        <span class="action-item overlay-close app-btn" data-to-close="userRoleSingleView">\n            <span class="material-icons">close</span>\n        </span>\n    </div>\n\n    <div id="userRoleSingleView" class="modelbox">\n        <div class="clearfix">&nbsp;</div>\n\n        <form id="userRoleDetails" name="userRoleDetails" action="#">\n            <div class="col-xs-12">\n                <div class="member-profile-img">\n                    <img src="">\n                </div>\n            </div>\n            <div class="col-xs-12">\n                <div class="row col-sm-12">\n                    <label for="roleName" style="margin-top: 0.5rem;">User Role Name<span class="error"> * </span> :\n                    </label>&nbsp;&nbsp;\n                    <input id="roleName" class="form-control txtchange col-4" name="roleName" type="text"\n                        value="<%= roleName%>">\n                </div>\n            </div>\n\n            <div class="clearfix">&nbsp;</div>\n\n            <div class="text-center">\n                <div class="clearfix">&nbsp;</div>\n                <button id="saveuserRoleDetails" type="button" class="btn btn-default btn-success">Save</button>\n            </div>\n        </form>\n    </div>\n</div>';});

define('plugin/userRole/views/userRoleSingleView',[
  'jquery',
  'underscore',
  'backbone',
  'validate',
  'inputmask',
  'datepicker',
  '../models/singleuserRoleModel',
  'text!../templates/userRoleSingle_temp.html',
], function($,_, Backbone,validate,inputmask,datepicker,singleuserRoleModel,userRoletemp){

var userRoleSingleView = Backbone.View.extend({
    model:singleuserRoleModel,
    initialize: function(options){
      this.toClose = "userRoleSingleView";
        var selfobj = this;
        $(".modelbox").hide();
        scanDetails = options.searchuserRole;
       
        $(".popupLoader").show();
      
        this.model = new singleuserRoleModel();
        if(options.roleID != ""){
          this.model.set({roleID:options.roleID});
          this.model.fetch({headers: {
            'contentType':'application/x-www-form-urlencoded','SadminID':$.cookie('authid'),'token':$.cookie('_bb_key'),'Accept':'application/json'
          },error: selfobj.onErrorHandler}).done(function(res){
            if(res.statusCode == 994){app_router.navigate("logout",{trigger:true});}
            $(".popupLoader").hide();
            selfobj.render();
            selfobj.setValues();
          });
        }else
        {
           selfobj.render();
           $(".popupLoader").hide();
        }
    },
    events:
    {
      "click #saveuserRoleDetails":"saveuserRoleDetails",
      "click .item-container li":"setValues",
      "blur .txtchange":"updateOtherDetails",
      "change .multiSel":"setValues",
      "change .bDate":"updateOtherDetails",
      "change .dropval":"updateOtherDetails",
    },
    onErrorHandler: function(collection, response, options){
        alert("Something was wrong ! Try to refresh the page or contact administer. :(");
        $(".profile-loader").hide();
    },
    updateOtherDetails: function(e){

      var valuetxt = $(e.currentTarget).val();
      var toID = $(e.currentTarget).attr("id");
      var newdetails=[];
      newdetails[""+toID]= valuetxt;
      this.model.set(newdetails);
    },
    setValues:function(e){
        setvalues = ["status"];
        var selfobj = this;
        $.each(setvalues,function(key,value){
          var modval = selfobj.model.get(value);
          if(modval != null){
            var modeVal = modval.split(",");
          }else{ var modeVal = {};}

          $(".item-container li."+value).each(function(){
            var currentval = $(this).attr("data-value");
            var selecterobj = $(this);
            $.each(modeVal,function(key,dbvalue){
              if(dbvalue.trim().toLowerCase() == currentval.toLowerCase()){
                $(selecterobj).addClass("active");
              }
            });
          });
          
        });
        setTimeout(function(){
        if(e != undefined && e.type == "click")
        {
          var newsetval = [];
          var objectDetails = [];
          var classname = $(e.currentTarget).attr("class").split(" ");
          $(".item-container li."+classname[0]).each(function(){
            var isclass = $(this).hasClass("active");
            if(isclass){
              var vv = $(this).attr("data-value");
              newsetval.push(vv);
            }
         
          });

          if (0 < newsetval.length) {
            var newsetvalue = newsetval.toString();
          }
          else{var newsetvalue = "";}

          objectDetails[""+classname[0]] = newsetvalue;
          $("#valset__"+classname[0]).html(newsetvalue);
          selfobj.model.set(objectDetails);
        }
      }, 500);
    },
    saveuserRoleDetails: function(e){
      e.preventDefault();
      var rid = this.model.get("roleID");
    if(permission.edit != "yes"){
        alert("You dont have permission to edit");
        return false;
      }
      if(rid == "" || rid == null){
        var methodt = "PUT";
      }else{
        var methodt = "POST";
      }
      if($("#userRoleDetails").valid()){
        var selfobj = this;
        $(e.currentTarget).html("<span>Saving..</span>");
        $(e.currentTarget).attr("disabled", "disabled");
        this.model.save({},{headers:{
          'Content-Type':'application/x-www-form-urlencoded','SadminID':$.cookie('authid'),'token':$.cookie('_bb_key'),'Accept':'application/json'
        },error: selfobj.onErrorHandler,type:methodt}).done(function(res){
        
          if(res.statusCode == 994){app_router.navigate("logout",{trigger:true});}
          if(res.flag == "F"){
            alert(res.msg);
            $(e.currentTarget).html("<span>Error</span>");
          }else{
            $(e.currentTarget).html("<span>Saved</span>");
            scanDetails.toClose = selfobj.toClose;
            scanDetails.filterSearch();
          }
          
          setTimeout(function(){
            $(e.currentTarget).html("<span>Save</span>");
            $(e.currentTarget).removeAttr("disabled");
            }, 3000);
          
        });
      }
    },
    initializeValidate:function(){
      var selfobj = this;
        $("#userRoleDetails").validate({
        rules: {
          roleName:{
             required: true,
          }
        },
        messages: {
          roleName: "Please enter User Role Name"
        }
      });
    },
    render: function(){

        var isexits = checkisoverlay(this.toClose);
        if(!isexits){
          var source = userRoletemp;
          var template = _.template(source);
  
          //var template = _.template(menuTemp);
          this.$el.html(template(this.model.attributes));
          this.$el.addClass("overlay");
          this.$el.addClass(this.toClose);
          this.$el.data("current","yes");
          //this.$el.html(res);
          $(".overlay-main-container").append(this.$el);
          $('#'+this.toClose).show();
          this.initializeValidate();
          this.setValues();
        }
        rearrageOverlays();
        return this;
    },onDelete: function(){
        this.remove();
    }
});

  return userRoleSingleView;
    
});

