define('plugin/category/views/categorySingleView',[
  'jquery',
  'underscore',
  'backbone',
  'validate',
  'inputmask',
  'datepicker',
  '../models/categorySingleModel',
  'text!../templates/categorySingle_temp.html',
], function ($, _, Backbone, validate, inputmask, datepicker, categorySingleModel,categorytemp) {

  var categorySingleView = Backbone.View.extend({
    model: categorySingleModel,
    initialize: function (options) {
      this.toClose = "categorySingleView";
      var selfobj = this;
      $(".modelbox").hide();
      scanDetails = options.searchcategory;
    
      $(".popupLoader").show();
      

      this.model = new categorySingleModel();

      if (options.categoryID != "") {
        this.model.set({ categoryID: options.categoryID });
        this.model.fetch({
          headers: {
            'contentType': 'application/x-www-form-urlencoded', 'SadminID': $.cookie('authid'), 'token': $.cookie('_bb_key'), 'Accept': 'application/json'
          }, error: selfobj.onErrorHandler
        }).done(function (res) {
          if (res.statusCode == 994) { app_router.navigate("logout", { trigger: true }); }
          $(".popupLoader").hide();
          selfobj.render();
          selfobj.setValues();
        });
      } else {
        selfobj.render();
        $(".popupLoader").hide();
      }
    },
    events:
    {
      "click #saveStateDetails": "saveStateDetails",
      "click .item-container li": "setValues",
      "blur .txtchange": "updateOtherDetails",
      "change .multiSel": "setValues",
      "click .multiOptionSel": "multioption",
      "change .bDate": "updateOtherDetails",
      "change .dropval": "updateOtherDetails",
      "change .fileAdded": "updateImage",
    },
    onErrorHandler: function (collection, response, options) {
      alert("Something was wrong ! Try to refresh the page or contact administer. :(");
      $(".profile-loader").hide();
    },
    multioption: function (e) {
      var selfobj = this;
      var issinglecheck = $(e.currentTarget).attr("data-single");
      if (issinglecheck == undefined) { var issingle = "N" } else { var issingle = "Y" }
      if (issingle == "Y") {
        var newsetval = [];
        var classname = $(e.currentTarget).attr("class").split(" ");
        newsetval["" + classname[0]] = $(e.currentTarget).attr("data-value");
        filterOption.set(newsetval);

      }
      if (issingle == "N") {
        setTimeout(function () {
          var newsetval = [];
          var objectDetails = [];
          var classname = $(e.currentTarget).attr("class").split(" ");
          $(".item-container li." + classname[0]).each(function () {
            var isclass = $(this).hasClass("active");
            if (isclass) {
              var vv = $(this).attr("data-value");
              newsetval.push(vv);
            }
          });

          if (0 < newsetval.length) {
            var newsetvalue = newsetval.toString();
          }
          else { var newsetvalue = ""; }

          objectDetails["" + classname[0]] = newsetvalue;
          filterOption.set(objectDetails);
        }, 500);
      }
    },
    updateImage: function (e) {
      var ob = this;
      var toID = $(e.currentTarget).attr("id");
      var newdetails = [];
      var reader = new FileReader();
      reader.onload = function (e) {
        document.getElementById("output").src = e.target.result;
        newdetails["" + toID] = reader.result;
        ob.model.set(newdetails);
      };
      reader.readAsDataURL(e.currentTarget.files[0]);

    },
    updateOtherDetails: function (e) {

      var valuetxt = $(e.currentTarget).val();
      var toID = $(e.currentTarget).attr("id");
      var newdetails = [];
      newdetails["" + toID] = valuetxt;
      this.model.set(newdetails);
    },
    setValues: function (e) {
      setvalues = ["status", "isFree"];
      var selfobj = this;
      $.each(setvalues, function (key, value) {
        var modval = selfobj.model.get(value);

        if (modval != null) {
          var modeVal = modval.split(",");
        } else { var modeVal = {}; }

        $(".item-container li." + value).each(function () {
          var currentval = $(this).attr("data-value");
          var selecterobj = $(this);
          $.each(modeVal, function (key, dbvalue) {
            if (dbvalue.trim().toLowerCase() == currentval.toLowerCase()) {
              $(selecterobj).addClass("active");
            }
          });
        });

      });
      setTimeout(function () {
        if (e != undefined && e.type == "click") {
          var newsetval = [];
          var objectDetails = [];
          var classname = $(e.currentTarget).attr("class").split(" ");
          $(".item-container li." + classname[0]).each(function () {
            var isclass = $(this).hasClass("active");
            if (isclass) {
              var vv = $(this).attr("data-value");
              newsetval.push(vv);
            }

          });

          if (0 < newsetval.length) {
            var newsetvalue = newsetval.toString();
          }
          else { var newsetvalue = ""; }

          objectDetails["" + classname[0]] = newsetvalue;
          $("#valset__" + classname[0]).html(newsetvalue);
          selfobj.model.set(objectDetails);
        }
      }, 500);
    },
    saveStateDetails: function (e) {
      e.preventDefault();
    //  var termstxt = CKEDITOR.instances.categoryDescription.getData();
    //  this.model.set({ 'categoryDescription': termstxt })
      var categoryID = this.model.get("categoryID");
      if (permission.edit != "yes") {
        alert("You dont have permission to edit");
        return false;
      }
      if (categoryID == "" || categoryID == null) {

        var methodt = "POST";
      } else {
        var methodt = "PUT";

      }

      if ($("#categoryDetails").valid()) {
        var selfobj = this;
        $(e.currentTarget).html("<span>Saving..</span>");
        $(e.currentTarget).attr("disabled", "disabled");
        this.model.save({}, {
          headers: {
            'Content-Type': 'application/x-www-form-urlencoded', 'SadminID': $.cookie('authid'), 'token': $.cookie('_bb_key'), 'Accept': 'application/json'
          }, error: selfobj.onErrorHandler, type: methodt
        }).done(function (res) {
          if (res.statusCode == 994) { app_router.navigate("logout", { trigger: true }); }
          if (res.flag == "F") {
            alert(res.msg);
            $(e.currentTarget).html("<span>Error</span>");
          } else {
            $(e.currentTarget).html("<span>Saved</span>");
            scanDetails.toClose = selfobj.toClose;
            scanDetails.filterSearch();
          }

          setTimeout(function () {
            $(e.currentTarget).html("<span>Save</span>");
            $(e.currentTarget).removeAttr("disabled");
          }, 3000);

        });
      }
    },
    initializeValidate: function () {
      var selfobj = this;
      $("#categoryDetails").validate({
        rules: {
          categoryName: {
            required: true,
          },
          categoryDescription: {
            required: true,
          },
        },
        messages: {
          categoryName: "Please enter category name",
          categoryDescription: "Please enter about category",
        }
      });
    },
    render: function () {
      var isexits = checkisoverlay(this.toClose);
      if(!isexits){
        var source = categorytemp;
        var template = _.template(source);

        //var template = _.template(menuTemp);
        this.$el.html(template({ "model": this.model.attributes }));
        this.$el.addClass("overlay");
        this.$el.addClass(this.toClose);
        this.$el.data("current","yes");
        //this.$el.html(res);
        $(".overlay-main-container").append(this.$el);
        $('#'+this.toClose).show();
        this.initializeValidate();
        this.setValues();
      }
        rearrageOverlays();
      return this;
    }, onDelete: function () {
      this.remove();
    }
  });

  return categorySingleView;

});

