        var __coltypTab= {"12/12":"col-sm-12","11/12":"col-sm-11","10/12":"col-sm-10","9/12":"col-sm-9","8/12":"col-sm-8","7/12":"col-sm-7","6/12":"col-sm-6","5/12":"col-sm-5","4/12":"col-sm-4","3/12":"col-sm-3","2/12":"col-sm-2","1/12":"col-sm-1"};
