define('text!plugin/subscribers/templates/subscribersFilterOption_temp.html',[],function () { return '<div id="filterData" class="modelbox">\n  <form id="demo-form" action="#">\n    <div class="clearfix">&nbsp;</div>\n    <div class="col-xs-6">\n      <select id="textSearch" class="form-control " roleName="textSearch">\n          <option value="roleName">Role Name</option>\n         \n        </select>\n    </div>\n    <div class="col-xs-6">\n      <input id="textval" class="form-control txtchange" roleName="textval" type="text">\n    </div>\n    <div class="clearfix">&nbsp;</div>\n    \n    <div class="clearfix">&nbsp;</div>\n    <div class="col-xs-6">\n    <label>Order By:</label>\n    <ul class="item-container" data-valid="orderBy">\n        <li class="orderBy multiOptionSel" data-single="Y" data-value="roleName">Role Name</li>\n        <li class="orderBy multiOptionSel" data-single="Y" data-value="createdDate">Created Date</li>\n        \n    </ul>\n    </div>\n    <div class="col-xs-6">\n    <label>Order:</label>\n    <ul class="item-container" data-valid="order">\n        <li class="order multiOptionSel" data-single="Y" data-value="ASC">Ascending</li>\n        <li class="order multiOptionSel" data-single="Y" data-value="DESC">Descending</li>\n    </ul>\n    </div>\n    <div class="clearfix">&nbsp;</div>\n    <div class="clearfix">&nbsp;</div>\n    <div class="col-xs-12">\n      <input type="button" id="filterSearch" class="btn btn-success" value="Search"></button>\n      <input type="button" id="resetSearch" class="btn btn-success resetval" value="Reset"></button>\n      \n    </div>\n    \n  </form>\n  \n</div>';});


define('plugin/subscribers/views/subscribersView',[
  'jquery',
  'underscore',
  'backbone',
  'datepicker',
  '../views/subscribersSingleView',
  '../collections/subscribersCollection',
  '../models/subscribersFilterOptionModel',
  'text!../templates/subscribersRow.html',
  'text!../templates/subscribers_temp.html',
  'text!../templates/subscribersFilterOption_temp.html',
], function($,_, Backbone,datepicker,subscribersSingleView,subscribersCollection,subscribersFilterOptionModel,subscribersRowTemp,subscribersTemp,subscribersFilterTemp){

var subscribersView = Backbone.View.extend({
    
    initialize: function(options){
        var selfobj = this;
        $(".profile-loader").show();
        var mname = Backbone.history.getFragment();
        permission = ROLE[mname];
        readyState = true;
        this.render();
        filterOption = new subscribersFilterOptionModel();
        searchsubscribers = new subscribersCollection();
        searchsubscribers.fetch({headers: {
          'contentType':'application/x-www-form-urlencoded','SadminID':$.cookie('authid'),'token':$.cookie('_bb_key'),'Accept':'application/json'
        },error: selfobj.onErrorHandler,type:'post',data:filterOption.attributes}).done(function(res){
          
          if(res.statusCode == 994){app_router.navigate("logout",{trigger:true});}
          $(".profile-loader").hide();
        setPagging(res.paginginfo,res.loadstate,res.msg);   
        });

      this.collection = searchsubscribers;
      this.collection.on('add',this.addOne,this);
      this.collection.on('reset',this.addAll,this);
      $(".right_col").on("scroll",function(){
            selfobj.loadData();
        });
    },
    events:
    {
      "blur #textval":"setFreeText",
      "change .range":"setRange",
      "change #textSearch":"settextSearch",
      "click .multiOptionSel":"multioption",
      "click #filterSearch": "filterSearch",
      "click #filterOption": "filterRender",
      "click .resetval":"resetSearch",
      "click .loadview":"loadSubView",
      "change .txtchange":"updateOtherDetails",
      "click .changeStatus": "changeStatusListElement",
      "click .showpage": "loadData",
      "keyup #searchText": "searchrecords",
    },
    updateOtherDetails: function(e){

      var valuetxt = $(e.currentTarget).val();
      var toID = $(e.currentTarget).attr("id");
      var newdetails=[];
      newdetails[""+toID]= valuetxt;
      filterOption.set(newdetails);
    },
    settextSearch: function(e){
      var usernametxt = $(e.currentTarget).val();
      filterOption.set({textSearch: usernametxt});
    },
 
    searchrecords: function (e) {
      var value = $(e.currentTarget).val().toLowerCase();
      $("#clist tr").filter(function() {
      $(this).toggle($(this).text().toLowerCase().indexOf(value) > -1)
    });
    },

    changeStatusListElement:function(e){
      var selfobj = this;
      var removeIds = [];
      var status = $(e.currentTarget).attr("data-action");
      var action = "changeStatus";
      $('#subscribersList input:checkbox').each(function(){
          if($(this).is(":checked"))
          {
            removeIds.push($(this).attr("data-subscriberID"));
          }
      });

      $(".action-icons-div").hide();
      $(".memberlistcheck").click(function() {
          if($(this).is(":checked")) {
              $(".action-icons-div").show(300);
          } else {
              $(".action-icons-div").hide(200);
          }
      });

      var idsToRemove = removeIds.toString();
      if(idsToRemove == ''){
        alert("Please select at least one record.");
        return false;
      }
        $.ajax({
            url:APIPATH+'emailSubscriber/status',
            method:'POST',
            data:{list:idsToRemove,action:action,status:status},
            datatype:'JSON',
             beforeSend: function(request) {
              $(e.currentTarget).html("<span>Updating..</span>");
              request.setRequestHeader("token",$.cookie('_bb_key'));
              request.setRequestHeader("SadminID",$.cookie('authid'));
              request.setRequestHeader("contentType",'application/x-www-form-urlencoded');
              request.setRequestHeader("Accept",'application/json');
            },
            success:function(res){
              if(res.flag == "F")
                alert(res.msg);

              if(res.statusCode == 994){app_router.navigate("logout",{trigger:true});}
              if(res.flag == "S"){
                 selfobj.collection.fetch({headers: {
                  'contentType':'application/x-www-form-urlencoded','SadminID':$.cookie('authid'),'token':$.cookie('_bb_key'),'Accept':'application/json'
                    },error: selfobj.onErrorHandler}).done(function(res){
                      if(res.statusCode == 994){app_router.navigate("logout",{trigger:true});}
                      $(".profile-loader").hide();
                      selfobj.filterSearch();
                    
                  });
              }
              setTimeout(function(){
                  $(e.currentTarget).html(status);
              }, 500);
              
            }
          });
    },
    
    onErrorHandler: function(collection, response, options){
        alert("Something was wrong ! Try to refresh the page or contact administer. :(");
        $(".profile-loader").hide();
    },
    loadSubView:function(e){
        var selfobj = this;
        var show = $(e.currentTarget).attr("data-view");
        
        switch(show)
        {
          case "singlesubscribersData":{
            var subscriberID = $(e.currentTarget).attr("data-subscriberID");
            
            var subscriberItem = new subscribersSingleView({subscriberID:subscriberID,searchsubscribers:this});
            console.log(subscriberItem)
            break;
          }
        }
    },
    resetSearch: function()
    {
      
        filterOption.set({curpage:0,subscriberID:null,textval: null,textSearch:'roleName',status:'subscribe',orderBy:'roleName',order:'ASC'});
        $(".multiOptionSel").removeClass("active");
        $("#textval").val("");
        $('#textSearch option[value=subscriberID]').attr('selected','selected');
        this.filterSearch();
    },
    loaduser:function(){
      var memberDetails  = new singlememberDataModel();
    },
    addOne: function(objectModel){
        var template = _.template(subscribersRowTemp);
        $("#subscribersList").append(template({subscribersDetails:objectModel}));
    },
    addAll: function(){
        $("#subscribersList").empty();
        this.collection.forEach(this.addOne,this);
    },
    filterRender:function(){
      $(".modal-dialog").removeClass("modal-lg");
      $(".modal-title").html("Filter Data");
      $(".modelbox").hide();
      if($('#filterData').length){
        $('#filterData').css("display","block");
      }else{
        var template = _.template(subscribersFilterTemp);
        $("#modalBody").append(template());
        $("#installDateFrom").datepicker({
          todayBtn:  1,
          autoclose: true,
          format:"yyyy/mm/dd",
        }).on('changeDate', function (selected) {
          var minDate = new Date(selected.date.valueOf());
          $('#installDateTo').datepicker('setStartDate', minDate);
        });
      
        $("#installDateTo").datepicker({format:"yyyy/mm/dd",autoclose: true})
          .on('changeDate', function (selected) {
              var minDate = new Date(selected.date.valueOf());
              $('#installDateFrom').datepicker('setEndDate', minDate);
        });
      }
    },
    multioption: function(e){
      var selfobj = this;
        var issinglecheck = $(e.currentTarget).attr("data-single");
        if(issinglecheck == undefined){var issingle ="N"}else{var issingle ="Y"}
        if(issingle=="Y")
        {
          var newsetval = [];
          var classname = $(e.currentTarget).attr("class").split(" ");
          newsetval[""+classname[0]] = $(e.currentTarget).attr("data-value");
          filterOption.set(newsetval);
          
        }
        if(issingle=="N")
        {
          setTimeout(function(){
            var newsetval = [];
            var objectDetails = [];
            var classname = $(e.currentTarget).attr("class").split(" ");
            $(".item-container li."+classname[0]).each(function(){
              var isclass = $(this).hasClass("active");
              if(isclass){
                var vv = $(this).attr("data-value");
                newsetval.push(vv);
              }
            });

            if (0 < newsetval.length) {
              var newsetvalue = newsetval.toString();
            }
            else{var newsetvalue = "";}

            objectDetails[""+classname[0]] = newsetvalue;
            filterOption.set(objectDetails);
            }, 3000);
        }
    },
    filterSearch: function(){
      $('.'+this.toClose).remove();
      rearrageOverlays();
        searchsubscribers.reset();
        var selfobj = this;
        readyState = true;
        filterOption.set({curpage: 0});
        var $element = $('#loadMember');
        
        $(".profile-loader").show();
       
        $element.attr("data-index",1);
        $element.attr("data-currPage",0);
       
        searchsubscribers.fetch({ headers:{
            'contentType':'application/x-www-form-urlencoded','SadminID':$.cookie('authid'),'token':$.cookie('_bb_key'),'Accept':'application/json'
            } ,add: true, remove: false, merge: false,error: selfobj.onErrorHandler ,type:'post', data:filterOption.attributes}).done(function(res){
                if(res.statusCode == 994){app_router.navigate("logout",{trigger:true});}
                $(".profile-loader").hide();
                
        setPagging(res.paginginfo,res.loadstate,res.msg);  
        $element.attr("data-currPage",index);
        $element.attr("data-index",res.paginginfo.nextpage);

                $(".page-info").html(recset);
                if(res.loadtraineeSkill === false){
                    $(".profile-loader-msg").html(res.msg);
                    $(".profile-loader-msg").show();
                }else{
                    $(".profile-loader-msg").hide();
                }
            });
    },
   
        loadData: function(e){
        var selfobj = this;
        var $element = $('#loadMember');
        var cid = $(e.currentTarget).attr("data-dt-idx");
        var isdisabled = $(e.currentTarget).hasClass("disabled");
        if(isdisabled){
          //
        }else{

        $element.attr("data-index",cid);
        searchsubscribers.reset();
        var index = $element.attr("data-index");
        var currPage = $element.attr("data-currPage");
        
        filterOption.set({curpage: index});
        var requestData = filterOption.attributes;
        
          $(".profile-loader").show();
          searchsubscribers.fetch({ headers: {
              'contentType':'application/x-www-form-urlencoded','SadminID':$.cookie('authid'),'token':$.cookie('_bb_key'),'Accept':'application/json'
            },add: true, remove: false, merge: false,type:'post',error: selfobj.onErrorHandler,data:requestData}).done(function(res){
              
              $(".profile-loader").hide();
              if(res.statusCode == 994){app_router.navigate("logout",{trigger:true});}
              
              setPagging(res.paginginfo,res.loadstate,res.msg);  
              $element.attr("data-currPage",index);
              $element.attr("data-index",res.paginginfo.nextpage);
          });
      }
    },
    render: function(){
        var template = _.template(subscribersTemp);
        this.$el.html(template());
        $(".app_playground").append(this.$el);
        return this;
    }
});

  return subscribersView;
  
});

define('plugin/dynamicForm/models/dynamicFormModel',[
  'underscore',
  'backbone',
], function(_, Backbone) {

  var dynamicFormModel = Backbone.Model.extend({
    idAttribute: "fieldID"
  });
  return dynamicFormModel;
});


define('plugin/dynamicForm/collections/dynamicFormCollection',[
  'underscore',
  'backbone',
  '../models/dynamicFormModel'
], function(_, Backbone,dynamicFormModel){

  var dynamicFormCollection = Backbone.Collection.extend({
    fieldID:null,
      model: dynamicFormModel,
      initialize : function(){

      },
      url : function() {
        return APIPATH+'dynamicFormFieldList';
      },
      parse : function(response){
        this.pageinfo = response.paginginfo;
        this.totalRecords = response.totalRecords;
        this.endRecords = response.end;
        this.flag = response.flag;
        this.msg = response.msg;
        this.loadstate = response.loadstate;
        return response.data;
      }
  });

  return dynamicFormCollection;

});
define('plugin/dynamicForm/models/singleDynamicFormModel',[
  'underscore',
  'backbone',
], function(_, Backbone) {

  var singleDynamicFormModel = Backbone.Model.extend({
    idAttribute: "fieldID",
     defaults: {
        fieldID:null,
        fieldLabel:'',
        fieldType:null,
        placeholder:null,
        defaultValue:'',
        fieldOptions:null,
        modifiedBy:null,
        createdDate:null,
        modifiedDate:null,
        allowMultiSelect:'no',
        status:'active',
        menuId:null,
    },
  	urlRoot:function(){
      return APIPATH+'dynamicformfield/'
    },
    parse : function(response) {
        return response.data[0];
      }
  });
  return singleDynamicFormModel;
});

define('text!plugin/dynamicForm/templates/dynamicFormSingle_temp.html',[],function () { return '<div class="container-fluid" id="dynamicFormSingleView">\n    <form id="dynamicFormDetails" name="dynamicFormDetails" action="#">\n        <div class="row clearfix">\n            <div class="col-lg-12 col-md-12 col-sm-12">\n                <div class="card">\n                    <div class="header">\n                        <h2> Dynamic Form </h2>\n                    </div>\n                    <div class="body">\n                        <div class="row clearfix">\n                            <div class="col-md-3">\n                                <div class="form-group">\n                                    <div class="form-line">\n                                        <label for="fieldLabel">Field Label</label><span class="error"> *</span>\n                                        <input type="text" class="form-control txtchange" placeholder="Field Label" id="fieldLabel" roleName="fieldLabel" value="<%=model.fieldLabel%>">\n                                    </div>\n                                </div>\n                            </div>\n                            <div class="col-md-3">\n                                <div class="form-group">\n                                    <div class="form-line">\n                                        <label for="fieldType">Field Type</label><span class="error"> *</span>\n                                        <select id="fieldType" name="fieldType" class="form-control dropval">\n                                            <option value="">Select Field Type</option>\n                                            <option value="Checkbox" <% if(model.fieldType == "Checkbox"){%> selected <%  } %>>Checkbox</option>\n                                            <option value="Dropdown" <% if(model.fieldType == "Dropdown"){%> selected <%  } %>>Dropdown</option>\n                                            <option value="Password" <% if(model.fieldType == "Password"){%> selected <%  } %>>Password</option>\n                                            <option value="Radiobutton" <% if(model.fieldType == "Radiobutton"){%> selected <%  } %>>Radio button</option>\n                                            <option value="Textarea" <% if(model.fieldType == "Textarea"){%> selected <%  } %>>Textarea</option>\n                                            <option value="Textbox" <% if(model.fieldType == "Textbox"){%> selected <%  } %>>Textbox</option>\n                                        </select>\n                                    </div>\n                                </div>\n                            </div>\n                            <div class="col-md-3">\n                                <div class="form-group">\n                                    <label for="placeholder">Placeholder</label>\n                                    <div class="form-line">\n                                        <input type="text" class="form-control txtchange" placeholder="Placeholder" id="placeholder" roleName="placeholder" value="<%=model.placeholder%>">\n                                    </div>\n                                </div>\n                            </div>\n                            <div class="col-md-3">\n                                <div class="form-group">\n                                    <div class="form-line">\n                                        <label for="defaultValue">Default Value</label>\n                                        <input type="text" class="form-control txtchange" placeholder="Default Value" id="defaultValue" roleName="defaultValue" value="<%=model.defaultValue%>">\n                                    </div>\n                                </div>\n                            </div>\n                        </div>\n                        <div class="row clearfix">\n                            <div class="col-md-12">\n                                <div class="form-group">\n                                    <div class="form-line">\n                                        <label for="fieldOptions">Field Options<span class="error"></span></label>\n                                        <input type="text" class="form-control txtchange" placeholder="Field Options" id="fieldOptions" name="fieldOptions" value="<%=model.fieldOptions%>">\n                                    </div>\n                                    <small>( Separate by comma )</small>\n                                </div>\n                            </div>\n                        </div>\n                        <div class="row clearfix">\n                            <div class="col-md-3">\n                                <div class="form-group">\n                                    <div class="form-line">\n                                        <label for="fieldIndex">Field Index<span class="error"></span></label>\n                                        <input type="text" class="form-control txtchange" placeholder="Field Index" id="fieldIndex" roleName="fieldIndex" value="<%=model.fieldIndex%>">\n                                    </div>\n                                </div>\n                            </div>\n                            <div class="col-md-3">\n                                <label for="allowMultiSelect">Allow Multi Select<span class="error"></span></label>\n                                <ul class="item-container" data-valid="allowMultiSelect">\n                                    <li class="allowMultiSelect multiSel" data-single="Y" data-value="no">No</li>\n                                    <li class="allowMultiSelect multiSel" data-single="Y" data-value="yes">Yes</li>\n                                </ul>\n                            </div>\n                            <div class="col-md-3">\n                                <label for="status">Status<span class="error"></span></label>\n                                <ul class="item-container" data-valid="status">\n                                    <li class="status multiSel" data-single="Y" data-value="active">Active</li>\n                                    <li class="status multiSel" data-single="Y" data-value="inactive">Inactive</li>\n                                </ul>\n                            </div>\n                        </div>\n                    </br>\n                    <button id="savedynamicFormDetails" type="button" class="btn btn-raised btn-primary m-t-15 waves-effect">Save</button>\n                    <button id="canceldynamicFormDetails" type="button" class="btn btn-raised btn-secondary m-t-15 waves-effect">Cancel</button>\n                    </div>\n                </div>\n            </div>\n        </div>\n    </form>\n</div>\n    <div class="container-fluid">\n        <div class="row clearfix">\n            <div class="col-lg-12">\n                <div class="card">\n                     <div class="header">\n                       <h2>Form Fields</h2>\n                   </div>\n                     <div class="body">\n                       <div class="actionList">\n                         <!-- <div class="action-icons-div ml-1"> -->\n                         \n                           <span type="button" style="display: none;" class="changeStatus deleteAll" data-action="delete"><i\n                               class="material-icons"\n                               style="background-color: #F5BF00; border-radius: 50%; padding: 2px 5px; margin-bottom: 10px;">delete</i></span>\n                           \n                       </div>\n                        <table id="cfieldlist" class="table bulk_action tableList table table-hover m-b-0 footable footable-1 footable-paging footable-paging-center breakpoint-lg">\n                         <thead id="thead">\n                           <tr class="footable-header">\n                             <th>\n                                <div class="listCheckbox">\n                                    <input id="cAll" class="checkall chk-col-amber" data-tocheck="cfieldlist" type="checkbox">\n                                    <label for="cAll">&nbsp;</label>\n                                </div>\n                             </th>\n                             <!-- <th class="column-title">User Role ID</th> -->\n                             <th class="column-title">Field Name</th>\n                             <th class="column-title">Field Type</th>\n                             <th class="column-title">Placeholder</th>\n                             <th class="column-title">Status</th>\n                             <th class="column-title">Action</th>\n                           </tr>\n                         </thead>\n                         <tbody id="dynamicFormListData">\n                            <% _.each(dynamicFormList, function(model1) { %>\n                              <tr>\n                                <td class="a-center">\n                                    <div class="listCheckbox">\n                                        <input id="cAll_<%= model1.attributes.fieldID %>" class="listcheckbox chk-col-amber" data-fieldID="<%= model1.attributes.fieldID %>" type="checkbox">\n                                        <label for="cAll_<%= model1.attributes.fieldID %>">&nbsp;</label>\n                                    </div>\n                                  </td>\n                                <td><%=model1.attributes.fieldLabel%></td>\n                                <td><%=model1.attributes.fieldType%></td>\n                                <td><%=model1.attributes.placeholder%></td>\n                                <td><%=model1.attributes.status%></td>\n                                <td>\n                                    <button type="button" class="ws-btn-default getFieldDetails" data-fieldID="<%=model1.attributes.fieldID%>"><i class="material-icons">mode_edit</i></button>\n                                </td>\n                              </tr>\n                            <%}); %>\n                          </tbody>\n                       </table>\n                       <div class="profile-loader-msg text-center"></div>\n                       <div class="profile-loader text-center">\n                           <div class="preloader">\n                             <div class="spinner-layer pl-amber">\n                                 <div class="circle-clipper left">\n                                     <div class="circle"></div>\n                                 </div>\n                                 <div class="circle-clipper right">\n                                     <div class="circle"></div>\n                                 </div>\n                             </div>\n                         </div>\n                       </div>\n                       <div id="loadMember" data-index="1" data-currPage="1"></div>\n                     </div>\n                     <!-- paggination -->\n                     <div class="row">\n                       <div class="col-sm-5">\n                         <div class="dataTables_info" id="datatable-checkbox_info" role="status" aria-live="polite"><span\n                             class="page-info"></span></div>\n                       </div>\n                       <div class="col-sm-7">\n                         <div class="showPageDetails dataTables_paginate paging_simple_numbers">\n                           <ul class="pagination">\n                           </ul>\n                         </div>\n                       </div>\n                     </div>\n                     <!-- paggination -->\n                    </div>\n                </div>\n            </div>\n        </div>\n    </div>';});

define('plugin/dynamicForm/views/dynamicFormSingleView',[
  'jquery',
  'underscore',
  'backbone',
  'validate',
  'inputmask',
  'datepicker',
  '../collections/dynamicFormCollection',
  '../models/singleDynamicFormModel',
  'text!../templates/dynamicFormSingle_temp.html',
], function($,_, Backbone,validate,inputmask,datepicker,dynamicFormCollection,singleDynamicFormModel,dynamicFormtemp){

var dynamicFormSingleView = Backbone.View.extend({
    model:singleDynamicFormModel,
    initialize: function(options){
      
        var selfobj = this;
        $(".modelbox").hide();
        scanDetails = options.searchdynamicForm;
        
        $(".popupLoader").show();
        
        this.dynamicFormList = new dynamicFormCollection();
        this.model = new singleDynamicFormModel();
        this.model.set({menuId:options.menuId});
        this.filterSearch();
        selfobj.render();
    },
    events:
    {
      "click #savedynamicFormDetails":"savedynamicFormDetails",
      "click #canceldynamicFormDetails":"canceldynamicFormDetails",
      "click .item-container li":"setValues",
      "blur .txtchange":"updateOtherDetails",
      "change .multiSel":"setValues",
      "change .bDate":"updateOtherDetails",
      "change .dropval":"updateOtherDetails",
      "click .iconSelection":"setIconValues",
      "click .getFieldDetails":"getFieldDetails",
      "click .changeStatus": "changeStatusListElement",
    },
    onErrorHandler: function(collection, response, options){
        alert("Something was wrong ! Try to refresh the page or contact administer. :(");
        $(".profile-loader").hide();
    },
    updateOtherDetails: function(e){

      var valuetxt = $(e.currentTarget).val();
      var toID = $(e.currentTarget).attr("id");
      var newdetails=[];
      newdetails[""+toID]= valuetxt;
      this.model.set(newdetails);
    },
    setValues:function(e){
        setvalues = ["status","allowMultiSelect"];
        var selfobj = this;
        $.each(setvalues,function(key,value){
          var modval = selfobj.model.get(value);
          if(modval != null){
            var modeVal = modval.split(",");
          }else{ var modeVal = {};}

          $(".item-container li."+value).each(function(){
            var currentval = $(this).attr("data-value");
            var selecterobj = $(this);
            $.each(modeVal,function(key,dbvalue){
              if(dbvalue.trim().toLowerCase() == currentval.toLowerCase()){
                $(selecterobj).addClass("active");
              }
            });
          });
          
        });
        setTimeout(function(){
        if(e != undefined && e.type == "click")
        {
          var newsetval = [];
          var objectDetails = [];
          var classname = $(e.currentTarget).attr("class").split(" ");
          $(".item-container li."+classname[0]).each(function(){
            var isclass = $(this).hasClass("active");
            if(isclass){
              var vv = $(this).attr("data-value");
              newsetval.push(vv);
            }
         
          });

          if (0 < newsetval.length) {
            var newsetvalue = newsetval.toString();
          }
          else{var newsetvalue = "";}

          objectDetails[""+classname[0]] = newsetvalue;
          $("#valset__"+classname[0]).html(newsetvalue);
          selfobj.model.set(objectDetails);
        }
      }, 3000);
    },
    savedynamicFormDetails: function(e){
      e.preventDefault();
      var mid = this.model.get("fieldID");
      
      /*if(permission.edit != "yes"){
        alert("You dont have permission to edit");
        return false;
      }*/
      if(mid == "" || mid == null){
        var methodt = "PUT";
      }else{
        var methodt = "POST";
      }
      if($("#dynamicFormDetails").valid()){
        var selfobj = this;
        $(e.currentTarget).html("<span>Saving..</span>");
        $(e.currentTarget).attr("disabled", "disabled");
        this.model.save({},{headers:{
          'Content-Type':'application/x-www-form-urlencoded','SadminID':$.cookie('authid'),'token':$.cookie('_bb_key'),'Accept':'application/json'
        },error: selfobj.onErrorHandler,type:methodt}).done(function(res){
          if(res.statusCode == 994){app_router.navigate("logout",{trigger:true});}
          if(res.flag == "F"){
            alert(res.msg);
            $(e.currentTarget).html("<span>Error</span>");
          }else{
            selfobj.filterSearch();
            $(e.currentTarget).html("<span>Saved</span>");
            
          }
          
          setTimeout(function(){
            $(e.currentTarget).html("<span>Save</span>");
            $(e.currentTarget).removeAttr("disabled");
            }, 3000);
          
        });
      }
    },
    canceldynamicFormDetails:function(e){
      var selfobj = this;
      var menuId = this.model.get("menuId");
      this.model.clear({silent: true});
      this.model.set({menuId:menuId});
      selfobj.render();
      selfobj.setValues();
    },
    changeStatusListElement:function(e){
      var selfobj = this;
      var removeIds = [];
      var status = $(e.currentTarget).attr("data-action");
      var action = "changeStatus";
      $('#dynamicFormListData input:checkbox').each(function(){
          if($(this).is(":checked"))
          {
            removeIds.push($(this).attr("data-fieldID"));
          }
      });

      $(".action-icons-div").hide();
      $(".listcheckbox").click(function() {
          if($(this).is(":checked")) {
              $(".action-icons-div").show(300);
          } else {
              $(".action-icons-div").hide(200);
          }
      });

      var idsToRemove = removeIds.toString();
      if(idsToRemove == ''){
        alert("Please select at least one record.");
        return false;
      }
        $.ajax({
            url:APIPATH+'dynamicformfield/status',
            method:'POST',
            data:{list:idsToRemove,action:action,status:status},
            datatype:'JSON',
             beforeSend: function(request) {
              $(e.currentTarget).html("<span>Updating..</span>");
              request.setRequestHeader("token",$.cookie('_bb_key'));
              request.setRequestHeader("SadminID",$.cookie('authid'));
              request.setRequestHeader("contentType",'application/x-www-form-urlencoded');
              request.setRequestHeader("Accept",'application/json');
            },
            success:function(res){
              if(res.flag == "F")
                alert(res.msg);

              if(res.statusCode == 994){app_router.navigate("logout",{trigger:true});}
              if(res.flag == "S"){
                selfobj.filterSearch();
              }
              setTimeout(function(){
                  $(e.currentTarget).html(status);
              }, 500);
              
            }
          });
    },
    initializeValidate:function(){
      var selfobj = this;
        $("#dynamicFormDetails").validate({
        rules: {
          fieldLabel:{
             required: true,
          },
          fieldType:{
             required: true,
          },
          status:{
            required:true,
          }
        },
        messages: {
          fieldLabel: "Please enter Field Label",
          fieldType: "Please select Field Type",
          status:"Please enter Status"
        }
      });
    },
    getFieldDetails: function(e){
      var selfobj = this;
      readyState = true;
      var fieldID = $(e.currentTarget).attr("data-fieldID");

      this.model.set({fieldID: fieldID});
          this.model.fetch({headers: {
            'contentType':'application/x-www-form-urlencoded','SadminID':$.cookie('authid'),'token':$.cookie('_bb_key'),'Accept':'application/json'
          },error: selfobj.onErrorHandler}).done(function(res){
            if(res.statusCode == 994){app_router.navigate("logout",{trigger:true});}
            $(".popupLoader").hide();
            selfobj.render();
            selfobj.setValues();
           
          });
      
    },
    filterSearch: function(){
      var selfobj = this;
      readyState = true;
      
      this.dynamicFormList.fetch({headers: {
        'contentType':'application/x-www-form-urlencoded','SadminID':$.cookie('authid'),'token':$.cookie('_bb_key'),'Accept':'application/json'
      },error: selfobj.onErrorHandler,type:'post', data:{status:'active',getAll:'Y',menuId:this.model.get("menuId")}}).done(function(res){
        if(res.statusCode == 994){app_router.navigate("logout",{trigger:true});}
        selfobj.render();
        $(".popupLoader").hide();
        $(".profile-loader").hide();
      });
    },
    render: function(){
        var source = dynamicFormtemp;
        var template = _.template(source);
        this.$el.html(template({"model":this.model.attributes,"dynamicFormList":this.dynamicFormList.models}));
        this.initializeValidate();
        this.setValues();
      
        $(".app_playground").append(this.$el);
        return this;
        
    },onDelete: function(){
        this.remove();
    }
});

  return dynamicFormSingleView;
  
});


